  false,\n\t\"url\": null,\n\t\"notes\": \"This is a proposal to conduct Red-shouldered
  Hawk inventory and monitoring research along the Mississippi River. Objectives of
  the proposed study include: (1) conduct an initial survey of potential Red-shouldered
  Hawk nesting habitat with Huron Island, Long Island and various other selected areas
  in Pools 21 and 22; (2) search previously active Red-shouldered Hawk nesting sites
  and potentially new nesting sites within the Milan Bottoms/Mill Creek study area;
  and (3) compare Red-shouldered Hawk reproductive success during the year 2000 within
  the Milan Bottoms with those found in other areas of the Mississippi River.\",\n\t\"owner_org\":
